import React, { Component } from 'react';
import "../../styles/LoginPage/LoginPage.css";
import { IoSpeedometerOutline } from "react-icons/io5";
import { Meta } from 'react-head';

class PasswordRenewal extends Component {
  handleRecoverPassword = () => {
    const { navigate } = this.props;
    if (typeof navigate === 'function') {
      navigate('/emailpasswordrecovery');
    } else {
      console.error("navigate prop is not a function");
    }
  };

  render() {
    return (
      <>
        <Meta name="viewport" content="width=device-width, initial-scale=1.0" />
        <div className="login-background">
          <div className="login-container">
            <h2 className="login-title">
              Speedster <IoSpeedometerOutline style={{ fontSize: '28px', color: 'white' }} />
            </h2>
            <label className="login-label">Login (e-mail/phone number)</label>
            <input type="text" className="login-input" />

            <button className="login-button" onClick={this.handleRecoverPassword}>
              Recover password
            </button>
          </div>
        </div>
      </>
    );
  }
}

export default PasswordRenewal;
